import React from 'react'

const Card = (props) =>
{
    const {name,email,id}=props;
    return(
    <div className='tc bg-light-yellow dib br3 pa3 ma2 grow bw2 shadow-5'>
        <img src = {`https://robohash.org/${id}?size=200x200;set=set4`} alt='robots'/>
        <div>
            <h2>{name}</h2>
            <p>{email}</p>
        </div>
    </div>
    );
}

export default Card;
